import { React } from "react";


const Navbar  = ()=>{
    return (
        <na class="navbar">
          <div class="logo"><a href="#">Protfo<span>lio.</span></a></div>
          <ul class="menu">
            <li><a href="#home" id="item">Home</a></li>
            <li><a href="#about" id="item">About us</a></li>
            <li><a href="#skill-box" id="item">Skill</a></li>
            <li><a href="#H1-Certificate" id="item">Certificate</a></li>
            <li><a href="#Projects" id="item">Project</a></li>
          </ul>
      </na>
    )
}

export default Navbar
